import React from 'react'
import "./Pages.css";

const Contact = () => {
  return (
    <div className="general px-4 w-[100%]">
      <div className="wrapper">
      <h2 className="text-5xl my-8 text-center greeting font-medium ">
          FeedBack 
        </h2>
      </div>
    </div>
  )
}

export default Contact
